webpackJsonp([0xafba99f31d82],{403:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Building Wisr",author:"Wisr, Inc."}},markdownRemark:{id:"/home/circleci/repo/src/pages/subschools-and-a-new-way-to-help/index.md absPath of file >>> MarkdownRemark",html:'<p>Wisr’s education data append lets our schools tie known <strong>degree data</strong> for alumni (degree type, graduation year, and major) to their pre-verified records, so that when an alum signs up, their degree is pre-populated in their profile.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-4a9bb.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 23.596938775510203%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image of CSV file for Wisr\'s education data append"\n        title=""\n        src="/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-fb8a0.png"\n        srcset="/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-1a291.png 148w,\n/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-2bc4a.png 295w,\n/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-fb8a0.png 590w,\n/static/updated-no-subschool-file-35b56fea8b211401238acdebaa8ec748-4a9bb.png 784w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Degree Data is Good</h3>\n<p>This education data append helps our schools maintain <strong>data integrity</strong>, because members will not have to manually enter their education data. Manual degree entry often results in spelling errors or inconsistent formatting for the major and degree type fields.</p>\n<p>However, for some of our larger state schools and research institutions, this education data append was missing an important piece of the picture: <strong><em>the school or college at the university where the degree was earned</em></strong>. Unlike a traditional four-year college, these institutions have graduate and professional schools and named undergraduate colleges.</p>\n<h3>More Contextual Degree Data is Better</h3>\n<p>We’re excited to share that we’ve released a new feature called <strong>Subschools</strong> to help address this issue and make it easier for our partner institutions to track and maintain consistent degree information for their alumni and students. With the feature, there’s a new column for <strong>Subschool</strong> in your education data file to optionally specify the particular ‘sub’ school or college that is associated with each degree that a person earns.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-ffbc3.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 21.052631578947366%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image of CSV file for Wisr\'s new education data append with a subschool column"\n        title=""\n        src="/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-fb8a0.png"\n        srcset="/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-1a291.png 148w,\n/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-2bc4a.png 295w,\n/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-fb8a0.png 590w,\n/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-526de.png 885w,\n/static/subschool-file-e0fc5ff5b2ae8a95470436ac2dea2fad-ffbc3.png 912w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>For example, at Wisr University, an alum may have a:</p>\n<ul>\n<li>B.A. in Marketing from the <strong>College of Liberal Arts and Sciences</strong> and an </li>\n<li>M.S. in Statistics from the <strong>Graduate School of Social Sciences</strong></li>\n</ul>\n<p>In addition to capturing <em>more contextual degree data</em>, this new feature also eases the reporting burden for site admins. This field is available in the members table, so they can now run a report for all alumni or students who’ve signed up for Wisr from a particular school or college, without needing to run a check against their entire CRM.</p>\n<p>Curious if the <strong>Subschool</strong> feature is something you’d like to turn on for your institution? Reach out to your Wisr Customer Success Manager to see if it’s right for you.</p>\n<h2>A New Way to Help</h2>\n<p>And lastly, we’ve added a new optional <em>Way to Help</em> that has been highly requested by many of the admins and faculty at our partner schools. It is:</p>\n<p><strong><em>Speaking on a panel or in a classroom</em></strong></p>\n<p>This selection will show up on members’ profiles and as an option to filter search results. This will make it extremely easy for faculty and staff to quickly identify alumni that are willing to volunteer their time and expertise to participate on a career-related panel or in the classroom to talk with students. </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/way-to-help-041e359206969b8dd45032f92bb24815-edf4b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.06015037593986%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Wisr member profile page with red cirlce around the Speaking on a panel in a classroom option"\n        title=""\n        src="/static/way-to-help-041e359206969b8dd45032f92bb24815-fb8a0.png"\n        srcset="/static/way-to-help-041e359206969b8dd45032f92bb24815-1a291.png 148w,\n/static/way-to-help-041e359206969b8dd45032f92bb24815-2bc4a.png 295w,\n/static/way-to-help-041e359206969b8dd45032f92bb24815-fb8a0.png 590w,\n/static/way-to-help-041e359206969b8dd45032f92bb24815-526de.png 885w,\n/static/way-to-help-041e359206969b8dd45032f92bb24815-fa2eb.png 1180w,\n/static/way-to-help-041e359206969b8dd45032f92bb24815-edf4b.png 1330w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>If you’d like to turn on this new option in your Wisr site, drop us a line at <a href="support@wisr.io">support@wisr.io</a> and we’ll get it set up for you. </p>\n<p>Thanks for reading!</p>',frontmatter:{title:"Subschools and a New Way to Help",date:"June 17, 2018",published:!0}}},pathContext:{slug:"/subschools-and-a-new-way-to-help/",previous:{fields:{slug:"/a-new-way-to-explore/"},frontmatter:{title:"A New Way to Explore",published:!0}},next:{fields:{slug:"/start-the-conversation-with-discussions/"},frontmatter:{title:"Start the Conversation with Discussions",published:!0}}}}}});
